import React from "react";

const Tuesday = () => {
  return (
    <div>
      <h1> Tuesday </h1>
      <form>
        <label>
          3 Miles RE:
          <input type="checkbox" name="name" />
        </label>
      </form>
    </div>
  );
};

export default Tuesday;
